I'll be taking part in a discussion on Art and Spirituality at the Ujazdowski Castle Centre for Contemporary Art in Warsaw, Poland -- on March 30th, 18:30 - 20:30 (GMT +1). You can join us in-person or online through the livestream. Please see the link in my bio for details. 

In attendance will be artists Daria Hlazatova and Łukasz Murzyn, along myself, and curators Manick Govinda and Agnieszka Kolek.

